import React, { useState } from 'react';
import { Table, Button } from 'react-bootstrap';
import { ArrowLeft } from 'react-bootstrap-icons';

const SurveyResponses = ({ surveys, onBack }) => {
  const [view, setView] = useState('summary'); // 'summary' or 'detail'
  const [selectedDate, setSelectedDate] = useState(null);

  // Agrupa las respuestas por fecha
  const groupedResponses = surveys.reduce((groups, survey) => {
    const date = new Date(survey._submission_time).toLocaleDateString();
    if (!groups[date]) {
      groups[date] = [];
    }
    groups[date].push(survey);
    return groups;
  }, {});

  // Función para renderizar valores
  const renderValue = (value) => {
    if (value === null || value === undefined) {
      return 'No respondido';
    }
    if (typeof value === 'object' && !Array.isArray(value)) {
      return JSON.stringify(value, null, 2);
    }
    if (Array.isArray(value)) {
      return value.join(', ');
    }
    return String(value);
  };

  const renderSummaryView = () => (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>Fecha</th>
          <th>Cantidad de Respuestas</th>
          <th>Acciones</th>
        </tr>
      </thead>
      <tbody>
        {Object.entries(groupedResponses).map(([date, responses], index) => (
          <tr key={date}>
            <td>{index + 1}</td>
            <td>{date}</td>
            <td>{responses.length}</td>
            <td>
              <Button 
                variant="outline-primary" 
                size="sm"
                onClick={() => {
                  setView('detail');
                  setSelectedDate(date);
                }}
              >
                Ver Respuestas
              </Button>
            </td>
          </tr>
        ))}
      </tbody>
    </Table>
  );

  const renderDetailView = () => (
    <div>
      <Button 
        variant="link" 
        className="text-decoration-none mb-3"
        onClick={() => {
          setView('summary');
          setSelectedDate(null);
        }}
      >
        <ArrowLeft /> Volver al resumen
      </Button>

      <h5 className="mb-3">Respuestas del {selectedDate}</h5>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            {Object.keys(groupedResponses[selectedDate]?.[0] || {}).map((key) => (
              <th key={key}>{key}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {groupedResponses[selectedDate]?.map((response, index) => (
            <tr key={index}>
              <td>{index + 1}</td>
              {Object.values(response).map((value, i) => (
                <td key={i}>{renderValue(value)}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </Table>
    </div>
  );

  return (
    <div className="container py-4">
      <div className="mb-4">
        <Button 
          variant="link" 
          onClick={onBack}
          className="text-decoration-none p-0"
        >
          <ArrowLeft /> Volver a proyectos
        </Button>
        <h4 className="mt-3">Respuestas de la Encuesta</h4>
      </div>

      {view === 'summary' ? renderSummaryView() : renderDetailView()}
    </div>
  );
};

export default SurveyResponses;
